description:
Bán đất mặt trục chính kinh doanh sầm uất TT Trâu Quỳ, Gia Lâm, HN:
- Dt 65m2, mặt tiền và hậu vuông vắn 4.5m;
- Khuôn đất siêu đẹp;
- Mặt kinh doanh sầm uất các loại mặt hàng
- Sinh viên đông đúc;
- Sổ sách sang tên luôn;
- Giá chỉ 11.2 tỷ có thương lượng - hỗ trợ vay NH
- LH em Huyền *** để xem đất 24/7
